import React, { useState } from 'react';
import JoblyApi from '../api';

const useSignUp = async (e, formData) => {
  const [token, setToken] = useState();

  e.preventDefault();
  const respToken = await JoblyApi.signUp(formData);
  setToken(respToken);

  return token;
};

export default useSignUp;
